    n = int(input())
    words = []
    for i in range(n):
        words.append(input())
    words.sort()
    groups = []
    for i in range(n):
        if i == 0:
            groups.append([words[i]])
        else:
            if words[i] == words[i-1]:
                groups[-1].append(words[i])
            else:
                groups.append([words[i]])
    print(len(groups))

